import React from 'react';
import './CardItem.css';
import CardItem from './CardItem.js';


const products = document.querySelector(".grid-container-woman"); 


function Dashboard(){
    return(
        <div id="woman-initial-section" clasName="woman-section">
          <h3 clasName="section-text">Woman</h3>
          <div clasName="grid-container-woman"></div>
          <div clasName="w-100 d-flex justify-content-end pb-5 ">
            <a clasName="mt-4 link-view-all" href="womanSubsectionAll.html">View All</a>
          </div>
        </div>    
    );
}

export default Dashboard;
